import React from "react";
import Navigation from "./components/Navigation";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route>
          <div className="App">
            <Navigation />
          </div>
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default App;
